;;;; graph of per-episode rewards and running totals
(defn stats
  [fits]
  (loop [[m r] (first fits)
         f (rest fits)
         i 0
         runs []
         norms []
         rs []
         ts []]
    (let [t (if (empty? runs) 0 (/ (reduce + runs) (count runs)))
          norm (ml/norm (get-in m [:network :parameters]))]
      (when (= (mod i 10) 0)
        (println (clojure.string/join "\t" [i (:explore m) norm r t])))
      (if (empty? f)
        (do
          (println "Best run:" (apply max ts))
          (list (plot/compose (plot/list-plot rs :joined true :color :blue :plot-range [:all [0 (apply max rs)]])
                              (plot/list-plot ts :joined true :color :red  :plot-range [:all [0 (apply max ts)]]))
                (plot/list-plot norms :joined true)))
        (recur (first f)
               (rest f)
               (inc i)
               (conj (if (< (count runs) 100) runs (subvec runs 1)) r)
               (conj norms norm)
               (conj rs r)
               (conj ts t))))))
