;; @@
(def model3
  (let [n 4
        outputs 2
        alpha 0.0001
        lambda 0.003
        hidden [64]
        layers (concat [n] hidden [outputs])
        network (-> (nn/make-neural-network hidden alpha lambda nn/quadratic-cost)
                    (assoc :layers layers)
                    (assoc :parameters (nn/init-parameters layers)))]
    (qn/make-q-network network
                       100000 ;; capacity
                       32    ;; batch
                       0.99   ;; discount
                       0.999  ;; decay
                       0.01
                       #(>= % 500))))

(def fits3 (take 400 (qn/q-network-fit model3 env)))
(stats fits3)
