(def model5
  (let [n 4
        outputs 2
        alpha 0.0001
        lambda 0.1
        hidden [64 32]
        layers (concat [n] hidden [outputs])
        network (-> (nn/make-neural-network hidden alpha lambda nn/quadratic-cost)
                    (assoc :layers layers)
                    (assoc :parameters (nn/init-parameters layers)))]
    (qn/make-q-network network
                       100000 ;; capacity
                       128    ;; batch
                       0.99   ;; discount
                       0.999  ;; decay
                       0.01
                       #(>= % 500))))

(def fits5 (take 500 (qn/q-network-fit model5 env)))
(stats fits5)
